import React from 'react';
import Movie from './Movie';

const Movies = ({movies, handleOnClick, clicked}) => {
  const MovieList = movies.map(movie => {
    return(
      <Movie
        // id={movie.id}
        title={movie.title}
        dateWatched={movie.dateWatched}/>
    );
  })

  return(
    <div className="movie-list">
      { MovieList }
    </div>
  )
}

export default Movies;
